import React from "react";
import userImg from '../images/image-jeremy.png';

import '../styles/userInfo.css'

const UserInfo = ()=>{
    return(
        <div className="userInfo">
            <img src={userImg} alt="Jeremy Robson"/>
            <div className="infoContainer">
                <h4>Report for</h4>
                <h1>Jeremy Robson</h1>
            </div>
        </div>
    );
}

export default UserInfo;
